import { Box, Button, Accordion, AccordionSummary, AccordionDetails, Divider, Paper, Stack, Step, StepLabel, Stepper, Typography, TextField, FormControl, FormLabel, RadioGroup, FormControlLabel, Radio, Grid, IconButton } from "@mui/material";
import { EventSeat, ArrowCircleRightOutlined, ExpandMore, TrendingFlat, Luggage, Restaurant, FlightClass, RestartAltOutlined } from '@mui/icons-material';
import { red, green, blue } from '@mui/material/colors';
import AppBar from "../components/AppBar";

import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { createContext, useContext, useState } from "react";

// TODO: Use styled-components
// TODO: Phone number input

const BookingContext = createContext({});
const SeatContext = createContext({});

export default function Booking() {
  const [step, setStep] = useState(0);
  const context = { step, setStep };

  const componentOfStep = [
    < Flights />,
    <PassengerForm />,
  ]

  return (
    <>
      <AppBar />
      <BookingContext.Provider value={context}>
        <Box padding={2} display='flex' justifyContent='center'>
          <Stack sx={{ width: '900px' }} spacing={2} direction='column' alignItems='stretch'>
            <Details />
            <Steps />
            <Stack alignItems='center'>
              <SeatSelection />
              {/* {componentOfStep[step]} */}
            </Stack>
          </Stack >
        </Box >
      </BookingContext.Provider>
    </>
  );
}

const left = 3, mid = 4, right = 3;
const rows = 10, columns = left + mid + right;

const occupied = Array((left + mid + right) * rows).fill(false).map(_ => Math.random() > 0.5);

function SeatSelection() {
  const [selectedSeat, setSelectedSeat] = useState(150);
  const context = { occupied, selectedSeat, setSelectedSeat };

  return (
    <SeatContext.Provider value={context}>
      <Grid container spacing={5} columns={columns} justifyContent='center'>
        <SeatContainer columns={left} rows={rows} offset={0} step={columns} />
        <SeatContainer columns={mid} rows={rows} offset={left} step={columns} />
        <SeatContainer columns={right} rows={rows} offset={left + mid} step={columns} />
      </Grid >
    </SeatContext.Provider>
  );
}

function Seat({ number }) {
  const { occupied, selectedSeat, setSelectedSeat } = useContext(SeatContext);

  const color = occupied[number]
    ? 'primary.main'
    : (selectedSeat === number ? 'orange' : 'grey')

  return (
    <IconButton
      onClick={() => { if (!occupied[number]) setSelectedSeat(number) }}
    >
      <EventSeat sx={{ fontSize: 60, color }} />
    </IconButton>
  );
}

function SeatContainer({ columns, rows, offset, step }) {
  return (
    <Grid container item xs={columns}>
      {[...Array(columns * rows).keys()].map(i => {
        const seatNumber = offset + (i % columns) + step * Math.floor(i / columns);

        return (
          <Grid item xs={12 / columns} key={seatNumber}>
            <Box display='flex' alignItems="center" justifyContent="center">
              <Seat number={seatNumber} />
            </Box>
          </Grid>
        );
      })}
    </Grid>
  );
}

function PassengerForm() {
  const { setStep } = useContext(BookingContext);

  return (
    <Stack spacing={1} sx={{ m: 'auto', maxWidth: '300px' }}>
      <TextField label="Name" />
      <TextField label="Surname" />
      <LocalizationProvider dateAdapter={AdapterDayjs}>
        <DatePicker />
      </LocalizationProvider>
      <TextField label="Turkish ID Number" />
      <TextField label="Phone number" />
      <GenderSelection value='female' onChange={() => { }} />
      <Button
        size='large'
        variant='contained'
        onClick={() => setStep(2)}
      >
        Submit
      </Button>
    </Stack>
  );
}

function GenderSelection({ value, onChange }) {
  return (
    <FormControl>
      <FormLabel id="demo-controlled-radio-buttons-group">Gender</FormLabel>
      <RadioGroup
        aria-labelledby="demo-controlled-radio-buttons-group"
        name="controlled-radio-buttons-group"
        value={value}
        onChange={onChange}
        row
      >
        <FormControlLabel value="female" control={<Radio />} label="Female" />
        <FormControlLabel value="male" control={<Radio />} label="Male" />
      </RadioGroup>
    </FormControl>
  );
}

function Steps() {
  const { step } = useContext(BookingContext);

  return (
    <Stepper alternativeLabel activeStep={step}>
      <Step>
        <StepLabel> Flight </StepLabel>
      </Step>
      <Step>
        <StepLabel> Passenger Information </StepLabel>
      </Step>
      <Step>
        <StepLabel> Personalisation </StepLabel>
      </Step>
      <Step>
        <StepLabel> Payment </StepLabel>
      </Step>
    </Stepper>
  )
}

function Details() {
  return (
    <Box sx={{ p: 3, }}>
      <Stack
        spacing={2}
        direction='row'
        justifyContent='center'
        alignItems='center'
        divider={<Divider orientation="vertical" flexItem />}
      >
        <Stack direction='row' spacing={1} alignItems='center'>
          <Typography fontWeight='bold' variant='h4'> Adana </Typography>
          <ArrowCircleRightOutlined sx={{ color: 'grey.500' }} />
          <Typography fontWeight='bold' variant='h4'> İzmir </Typography>
        </Stack>

        <Typography>
          <strong> Departure flight:</strong>
          14 Dec 2023, Thu
        </Typography>
      </Stack>
    </Box>
  );
}

const flights = [
  { id: 0, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
  { id: 1, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
  { id: 2, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
  { id: 3, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
  { id: 4, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
  { id: 5, from: 'ADA', to: 'ADB', departure: new Date(), arrival: new Date(), price: 1092.49 },
]

function Flights() {
  return (
    <Stack spacing={0}>
      {flights.map(({ id, ...props }) => <Flight key={id} {...props} />)}
    </Stack>
  );
}


function Flight({ from, to, departure, arrival, price }) {
  return (
    <Accordion disableGutters>
      <AccordionSummary
        expandIcon={<ExpandMore />}
        aria-controls="panel1a-content"
        id="panel1a-header"
      >
        <Stack sx={{ p: 1, width: '100%' }} direction='row' justifyContent='space-between' alignItems='center'>
          <Stack flex={7} direction='row' justifyContent='space-between' alignItems='center'>
            <Box>
              <Typography fontWeight='bold' color="grey.500"> {from} </Typography>
              <Typography fontWeight='bold' variant='h5'> 08:30 </Typography>
            </Box>
            <TrendingFlat />
            <Box>
              <Typography fontWeight='bold' color="grey.500"> {to} </Typography>
              <Typography fontWeight='bold' variant='h5'> 10:30 </Typography>
            </Box>
          </Stack>
          <Typography fontWeight='bold' flex={6} textAlign='right' variant="h5"> {price} ₺ </Typography>
        </Stack>
      </AccordionSummary>

      <AccordionDetails>
        <Stack spacing={1} sx={{ paddingBottom: 1 }} direction='row' justifyContent='space-evenly'>
          <Plan label='essentials' dash={blue[500]} price={price}>
            <Benefit icon={<Luggage />}> 15 Kg. Luggage </Benefit>
          </Plan>
          <Plan label='advantage' dash={green[500]} price={price + 200}>
            <Benefit icon={<Luggage />}> 25 Kg. Luggage </Benefit>
            <Benefit icon={<FlightClass />}> Standard Seat Selection </Benefit>
            <Benefit icon={<Restaurant />}> Sandwich </Benefit>
          </Plan>
          <Plan label='comfort' dash={red[500]} price={price + 400}>
            <Benefit icon={<Luggage />}> 45 Kg. Luggage </Benefit>
            <Benefit icon={<FlightClass />}>  Seat Selection </Benefit>
            <Benefit icon={<Restaurant />}> Sandwich </Benefit>
          </Plan>
        </Stack>
      </AccordionDetails>
    </Accordion >
  );
}

function Plan({ label, price, dash, children }) {
  const { setStep } = useContext(BookingContext);

  return (
    <Paper
      sx={{
        p: 2,
        width: '270px',
        backgroundColor: 'grey.50',
        borderTop: 10,
        borderColor: dash
      }}
    >
      <Stack spacing={1} alignItems='center' justifyContent='center'>
        <Typography
          fontWeight='bold'
          textTransform='uppercase'
          variant='h6'
        >
          {label}
        </Typography>

        <Stack
          direction='column'
          spacing={1}
          sx={{
            minWidth: '190px',
            height: '160px'
          }}
        >
          {children}
        </Stack>

        <Button
          sx={{ minWidth: '190px' }}
          variant='contained'
          onClick={(_) => setStep(1)}
        >
          {price} ₺
        </Button>
      </Stack>
    </Paper>
  )
}

function Benefit({ icon, children }) {
  return (
    <Stack spacing={1} direction='row' alignItems='center'>
      {icon}
      <Typography> {children} </Typography>
    </Stack>
  );
}
